    "detroit-lakes-wetland-management-district-annual-narrative-report-calendar-year-1985",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Detroit
    Lakes Wetland Management District outlines District accomplishments during the 1985
    calendar year. The report begins by giving brief District highlights and describing
    the climate and habitat conditions in the District, as well as the land acquisition
    program, funding, and system status. The planning section details the master plan,
    management plan, public participation, compliance with environmental mandates, and
    research and investigation. Administration describes personnel, youth programs,
    other manpower programs, funding, safety, and technical assistance. The habitat
    management section discusses croplands, grasslands, prescribed fire, grazing, haying,
    vegetation control, plantings, wetlands, wilderness and special areas, and easements
    for waterfowl management. Wildlife- including endangered and threatened species,
    migratory birds, and big game animals- are discussed. The public relations sections
    describes information and interpretation, recreational uses, hunting, trapping,
    wildlife viewing, and enforcement. The construction and maintenance section describes
    recent construction, energy conservation, and equipment utilization and replacement.
    Cooperative programs, items of interest, and feedback are discussed. Photographs
    and brochures are attached.",nt"license_title": "License Not Specified",nt"extras":
